import React from 'react';
import ReactSelect from 'react-select';
import { Link } from 'react-router-dom';


const NoteList = ({NoteWithTags, DeleteNotes})=>{
    return(
        <div className="container">

            <div className="header">
                <h1>Note</h1>
                <div className="buttons">
                    <Link to={"/new"}  >
                    <button>Create</button>
                    </Link>
                    <button onClick={DeleteNotes} >Edit Tag</button>
                </div>
            </div>
            <div className="sub_body">
                <div className="title">
                <label htmlFor="title">Title</label>
                <input type="text" id='title' />
                </div>
                <div className="tags">
                <label htmlFor="tags">Tags</label>
                <ReactSelect id='tags' />
                </div>
            </div>

            <div className="main_body">
                {NoteWithTags.map((note)=>{
                    return <div key={note.id} className="card">
                        <h3>{note.title}</h3>
                        {note.tag.map((tag)=> <h5 key={tag.id}>{tag.label}</h5>)}
                    </div>
                })               
                }
                {console.log(NoteWithTags, "note with tags Notelist")}
            </div>

        </div>
    )
}

export default NoteList
